import React from "react";
import "./roadmap.css";

class Roadmap extends React.Component {
  render() {
  return(
  <div className="section-2">
    <div className="container">
      <div className="row">
        <div className="roadmap-head">
          <h2>Roadmaps</h2>
          <p>Explore and try something new!!</p></div>
      </div>

    </div>
  </div>
  )
}
}

export default Roadmap;
